function LineTitle(props) {
    let addClass = "";
    if (props.Light === true && props.OnlyLine === true) {
        addClass = "LightGreenFontShade LightLine  LineTextLine ";
    } else if (props.Light === true && props.OnlyLine === false) {
        addClass = "LightGreenFontShade LightLine  LineTextLine ";
    }else if (props.Light === false && props.OnlyLine === true) {
        addClass = "LightLine  LineTextLine ";
    } else if (props.Light === false && props.OnlyLine === false) {
        addClass = "LightGreenFontShade LightLine  LineTextLine ";
    }

    return(
        <h2 className={addClass+" CursiveFont MdFont"}>{props.Title}</h2>
    );
}

export default LineTitle;
